import style from "./InitialPage.module.scss";
import { BoxesMenuItem } from "./BoxesMenuItem/BoxesMenuItem";

const InitialPage = () => {
  return (
    <div>
      <div className={style.boxesContainer}>
        <BoxesMenuItem textContent="Repeat words" imgContent="people_2.png" />
        <BoxesMenuItem textContent="Dictionary" imgContent="people_1.png" />
      </div>
    </div>
  );
};

export { InitialPage };
